"Arguments must be aggregate pipeline operators" using MongoDB and NodeJS<p>I have below code which is working fine and displaying 100 records descending order of <code>Vote</code> value from <code>MongoDB</code> collection;</p>

<pre><code>var myAggregate = Entry.aggregate([{ $group: { _id: "$url",author: { $first: "$author" }, vote: { $max: "$vote" }, url: { $first: "$url" }, title: { $first: "$title" } } },{ $sort:{ vote:-1} },{ $limit: 100 }]);

// Home Route
app.get('/', function(req, res) {
  myAggregate.exec(function(err, entries) {
      if (err) {
          console.log(err)
      } else {
          res.render('index', {
              entries: entries
          });
      }
  });
});
</code></pre>

<p>What i am trying to achieve is to filter this data based on today's date.</p>

<p>My schema looks like this;</p>

<pre><code>{
    "_id": {
        "$oid": "5ec6efe565915b59f10787b4"
    },
    "title": "my title",
    "url": "https://myurl.com",
    "author": "john",
    "created": {
        "$date": "2020-05-22T00:17:14.340Z"
    },
    "vote": 51
}
</code></pre>

<p>My index page should display 100 records which are created <strong><code>today</code></strong>.</p>

<p>So for example if my entry is created within Today's date and time range then it should be displayed.</p>

<p>I tried to follow explanation on <a href="https://stackoverflow.com/questions/29327222/mongodb-find-created-results-by-date-today">this</a> question but did not work for me.I am receiving <code>Arguments must be aggregate pipeline operators error</code>. Any idea what i am missing here?</p>

<pre><code>var start = new Date();
start.setHours(0,0,0,0);

var end = new Date();
end.setHours(23,59,59,999); 

var myAggregate = Entry.aggregate([{ $group: { _id: "$url",author: { $first: "$author" }, vote: { $max: "$vote" }, url: { $first: "$url" }, title: { $first: "$title" } } },{ $sort:{ vote:-1} },{created: {$gte: start, $lt: end}},{ $limit: 100 }]);
</code></pre>

