Same constant is defined with GET but undefined with POST - express, mongo, react<p>I'm following a React tutorial, in which I am building a basic blog in MERN stack.</p>
<p>In this particular case, in my <code>Server.js</code> file I am attempting a <code>POST</code> request to MongoDB. It identifies the collection &amp; JSON object using URL parameters, alters the object &amp; returns a new constant equal to the new object.</p>
<p>The issue is that the <code>const </code> equal to the object found is showing to be not defined. However, I cannot figure out why that would be. Another function using a <code>GET</code> request with the same <code>const</code> (each are local to their respective functions) works as designed with no error regarding defining the <code>const</code>.</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import express from 'express';
import bodyParser from 'body-parser';
import { MongoClient } from 'mongodb';

const app = express();

// also tried to use express' built in bodyparser, same error
app.use(bodyParser.json());

// working GET req function using the same const
app.get('/api/articles/:name', async (req,res) =&gt; {
    try {
        const articleName = req.params.name;

        const client = await MongoClient.connect('mongodb://localhost:27017', { useNewUrlParser: true });
        const db = client.db('my-app-db');

// this is the const in question, equal to object found
// based on name param passed in URL
        const articleInfo = await db.collection('articles').findOne({ name: articleName });
        res.status(200).json(articleInfo);

        console.log(articleInfo);

        client.close();
    } catch (error) {
        res.status(500).json({message: 'Error connecting to db', error});
    }

});

// non working POST req function, using the same const
// added slash to front of path as it was originally missing, still 
// getting error
app.post('/api/articles/:name/upvote', async (req,res) =&gt; {
    try {
        const articleName = req.params.name;

        const client = await MongoClient.connect('mongodb://localhost:27017', { useNewUrlParser: true });
        const db = client.db('my-app-db');

        // gets error for being undefined at Server.js 32:5
        const articleInfo = await db.collection('articles').findOne({ name: articleName });
        await db.collection('articles').updateOne({ name: articleName },{
            '$set' : {
                upvotes: articleInfo.upvotes + 1,
            }, 
        });

        // this is updated article sent as response 
        const updatedArticleInfo = await db.collection('articles').findOne({ name: articleName });

        res.status(200).json(updatedArticleInfo);
        client.close();

    } catch (error) {
        res.status(500).json({message: 'Error connecting to db', error});
    }
})

app.listen(8000, () =&gt; console.log('Listening on port 8000'));</code></pre>
