How to join multiple collections in MongoDB (one to many relationship)?<p>I have two collections: <code>document</code> and <code>citation</code>. Their structures are shown below:</p>

<pre><code># document
{id:001, title:'foo'}
{id:002, title:'bar'}
{id:003, title:'abc'}

# citation
{from_id:001, to_id:002}
{from_id:001, to_id:003}
</code></pre>

<p>I want to query the information of cited documents (called references, which is denoted by <code>to_id</code>) of each document. In SQL, I would use the <code>document</code> table left joins <code>citation</code>, and then left joins <code>document</code> to get full information of the references (not just their ids).</p>

<p>However, I can only achieve the first step with <code>$lookup</code> in MongoDB. Here is my aggregate pipeline:</p>

<pre><code>[
    {'$lookup':{
        'from': 'citation',
        'localField': 'id',
        'foreignField': 'from_id',
        'as': 'references'
    }}
]
</code></pre>

<p>I am able to get the following results with this pipeline:</p>

<pre><code>{
    id:001,
    title:'foo',
    references:[{from_id:001, to_id:002}, {from_id:001, to_id:003}]
}
</code></pre>

<p>The desired result is:</p>

<pre><code>{
    id:001,
    title:'foo',
    references:[{id:002, title:'bar'}, {id:003, title:'abc'}]
}
</code></pre>

<p>I have found this <a href="https://stackoverflow.com/questions/35813854/how-to-join-multiple-collections-with-lookup-in-mongodb">answer</a> but it seems to be a one-to-one relationship that is not applicable in my case.</p>

<p>EDIT: Some people said that join should be avoided in MongoDB as it's not a relational database. I choose MongoDB because it's much faster than MySQL in my case.</p>

